interface IComponentProps {
    className?: string | Array<string>,
    name: string,
    inheritFill?: boolean,
    inheritStroke?: boolean,
}

const SVGIcon: React.SFC<IComponentProps> = (props) => {
    const {
        name,
        className,
        inheritFill,
        inheritStroke,
    } = props;

    const classname = classnames(
        className,
        BASE_CLASSNAME,
        `${BASE_CLASSNAME}-${name}`, {
            [`${BASE_CLASSNAME}--inherit-color`]: inheritFill,
            [`${BASE_CLASSNAME}--inherit-stroke`]: inheritStroke,
        },
    );

    return (<svg className={classname}><use xlinkHref={`#svgSprite-${name}`} /></svg>);
};

SVGIcon.propTypes = {
    className: PropTypes.oneOfType([PropTypes.string, PropTypes.array]),
    name: PropTypes.string.isRequired,
    inheritFill: PropTypes.bool,
    inheritStroke: PropTypes.bool,
};

SVGIcon.defaultProps = {
    className: null,
    inheritFill: false,
    inheritStroke: false,
};

export { SVGIcon as default, SVGIconsDefinitions };
